sourcesContent:
export default function makeCreateTicket({
    Ticket,
}) {
    return async function createTicket({
        idTicket,
        fechaCreacion,
        estado,
        descripcion,
        establecimiento,
        idUsuario 
    })

     {
        try {
            //const newTicket = Ticket.createTicket({
             //   idUser,
             //   comment,
            //})

            return {
                error: false,
                message: 'Ticket created successfully',
                data: {
                    idTicket,
                    fechaCreacion,
                    estado,
                    descripcion,
                    establecimiento,
                    idUsuario 
                }
            }

        } catch (error) {
            console.log({error});
            return {
                error: true,
                message: 'An error occurred when creating the ticket',
            }
        }

    }
}

